import React from 'react';
import { Link } from 'react-router-dom';
import { Container, Title, OpenCreateTodo } from './styles';


const Todos: React.FC = () => {

  return (
    <>
      <Container>
        <Title>Todo List</Title>
        <OpenCreateTodo>
          +
          <Link to ="/createtodo"></Link>
        </OpenCreateTodo>
      </Container>
    </>
  )
}

export default Todos
